import React from 'react';
import './Home.css';
import Photo from './images/Photo.jpg';

function Home()
{
  return(
    <div className="Home" id="home">
      <table className="table">
       <tr>
        <td className="image">
          <img src={Photo}/>
        </td>
        <td className="para">
          <p>
            Hi, <b>Sai Madhav</b> here...<br/>
            <i>Software Engineer with Keen Interest in Web Development</i>...<br/>
            You can reach out to me via <br/>
            <a href="https://www.linkedin.com/in/smadhavkv96/" rel="no-opener no-referrer" target="_blank">&nbsp; LinkedIn</a> <i>or</i><br/>
            <a href="www.github.com/kvsaimadhav"rel="no-opener no-referrer" target="_blank">&nbsp; Github</a><br/>
          </p>
        </td>
        </tr>
      </table>
    </div>
  );
}

export default Home;
